import {Component} from 'react';
import Table from './Table';


class App extends Component{
    render(){
        const character=[
            {
                name:"purus",
                age:23,
                city:"jaffna"
            },
            {
                name:"keerthan",
                age:13,
                city:"jaffna"
            },{
                name:"vithu",
                age:15,
                city:"jaffna"
            }
        ]
      return (
        <div className="table-container">
      <h1 className='heading'>Hello World!!!</h1>

      <h2>Table 1</h2>
      <Table character={character}/>
      
      </div>
    )
    }
  } 
  export default App;
